import { Div } from "./Style";
import DemoCarousel from "./Component/Transaction/Transaction";
import Headercontent from "./Component/Headercontent/Headercontent";
// import Circularprogressbar from "./Component/Header/Header";
import Linechart from "./Component/LineChart/LineChart";
// import { Header } from './../../todo/src/style';
// import { LineChart } from 'react-linechart';
import Circularprogressbar from "./Component/CircularProgressBar/CircularProgressBar";

export default class App extends Component {
  state = {};
  render() {
    return (
      <div>
        <Div>
            <Headercontent />
        </Div>
        <div style={{ width: "100%", backgroundColor: "#eeeeee" }}>
          <Div>
            <DemoCarousel />
          </Div>
        </div>
        <div

        >
          <Circularprogressbar />
        </div>
        <Linechart />
      </div>
    );
  }
}
